import React from "react";
import { Card, CardBody, CardImg, CardText, CardTitle } from "reactstrap";
import style from "./ProductCard.module.css";
import { NavLink } from "react-router-dom";

function ProductCard(props) {
    const { id, name, product_type, image_link } = props;

    return (
        <NavLink to={`/products/${id}`}>
            <Card className={`h-100 text-dark`}>
                <CardImg className={style.image} top src={image_link} alt={name} />
                <CardBody className="d-flex flex-column justify-content-end text-centered">
                    <CardTitle
                        className={`${style.overflow} small-caps fs-6 text-primary`}
                    >
                        {name}
                    </CardTitle>
                    <CardText className={style.overflow}>{product_type}</CardText>
                    <div className="btn btn-primary" to={`/products/${id}`}>
                    </div>
                </CardBody>
            </Card>
        </NavLink>
    );
}

export default ProductCard;
